prediction.sparql:
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?person ?personLabel ?dateOfDeath WHERE {
  ?person wdt:P21 wd:Q6581072 .
  ?person wdt:P570 ?dateOfDeath .
  FILTER ( ?dateOfDeath < "1948-01-01T00:00:00Z" ^^ xsd:dateTime ) .
  {
    ?person wdt:P19 ?birthPlace .
    ?birthPlace wdt:P131 * wd:Q3240 .
  } UNION {
    ?person wdt:P20 ?deathPlace .
    ?deathPlace wdt:P131 * wd:Q3240 .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
}
LIMIT 20

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?person ?personLabel ?amount ?unit ?conversionRate ?netWorthUSD WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P21 wd:Q6581072 ; wdt:P2218 ?amount .
  BIND( "USD" AS ?unit ) BIND( 1 AS ?conversionRate ) BIND( ?amount AS ?netWorthUSD ) FILTER ( ?amount >= 1000000000 ) OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
}
ORDER BY DESC ( ?netWorthUSD )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?numUnmarriedPartners ( SUM( IF( ?gender = wd:Q6581072 , 1 , 0 ) ) AS ?numFemaleArtists ) ( SUM( IF( ?gender = wd:Q6581097 , 1 , 0 ) ) AS ?numMaleArtists ) WHERE {
  {
    SELECT ?artist ?gender ( COUNT( ?unmarriedPartner ) AS ?numUnmarriedPartners ) WHERE {
      ?artist wdt:P106 wd:Q108289408 .
      ?artist wdt:P21 ?gender .
      OPTIONAL {
        ?artist wdt:P451 ?unmarriedPartner
      }
    }
    GROUP BY ?artist ?gender
  }
}
GROUP BY ?numUnmarriedPartners
ORDER BY ?numUnmarriedPartners

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?version ?versionLabel ?publicationDate WHERE {
  wd:Q83 p:P348 ?statement .
  ?statement ps:P348 ?version .
  OPTIONAL {
    ?statement pq:P577 ?publicationDate .
  }
  OPTIONAL {
    ?version rdfs:label ?versionLabel FILTER ( LANG( ?versionLabel ) = "en" )
  }
}
ORDER BY ?publicationDate

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?goat ?goatLabel ?image ?startTime ( COALESCE ( ?endTime , NOW () ) AS ?endTime ) WHERE {
  ?goat wdt:P31 wd:Q2934 .
  ?goat rdfs:label ?goatLabel .
  FILTER ( CONTAINS( LCASE( ?goatLabel ) , "hennes" ) ) OPTIONAL {
    ?goat wdt:P18 ?image .
  }
  OPTIONAL {
    ?goat p:P39 ?positionStatement .
    ?positionStatement ps:P39 wd:Q151345 ; pq:P580 ?startTime .
    OPTIONAL {
      ?positionStatement pq:P582 ?endTime .
    }
  }
}
ORDER BY ?startTime

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?mountain ?mountainLabel ?elevation WHERE {
  ?mountain wdt:P31 wd:Q8502 ; wdt:P2044 ?elevation .
  FILTER ( ?elevation > 8000 ) OPTIONAL {
    ?mountain wdt:P276 ?location .
  }
  FILTER ( ! BOUND( ?location ) || NOT EXISTS {
    ?location wdt:P31 / wdt:P279 * wd:Q6999 .
  }
  ) OPTIONAL {
    ?mountain rdfs:label ?mountainLabel FILTER ( LANG( ?mountainLabel ) = "en" )
  }
}
ORDER BY DESC ( ?elevation )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?event WHERE {
  ?event wdt:P31 / wdt:P279 * wd:Q46190676 .
  ?event wdt:P2094 wd:Q16893072 .
  FILTER NOT EXISTS {
    ?event wdt:P1346 ?winner
  }
  ?event wdt:P361 ?tournament .
  ?tournament ( wdt:P361 | wdt:P279 ) * ?circuit .
  VALUES ?circuit {
    wd:Q300008 wd:Q3775082
  }
}
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?institution ?institutionLabel ( COUNT( DISTINCT ?thesis ) AS ?thesisCount ) WHERE {
  ?thesis wdt:P4101 ?institution .
  ?thesis wdt:P31 ?thesisType .
  VALUES ?thesisType {
    wd:Q1266946 wd:Q187685
  }
  .
  OPTIONAL {
    ?institution rdfs:label ?institutionLabel FILTER ( LANG( ?institutionLabel ) = "en" )
  }
}
GROUP BY ?institution ?institutionLabel
ORDER BY DESC ( ?thesisCount )
LIMIT 100

