    ?item wdt:P571 ?yearOfCreation .
  }
  OPTIONAL {
    ?item wdt:P547 ?commemoratedEntity .
    OPTIONAL {
      ?commemoratedEntity rdfs:label ?commemoratedEntityLabel FILTER ( LANG( ?commemoratedEntityLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  OPTIONAL {
    ?item wdt:P625 ?coordinate .
  }
  OPTIONAL {
    ?item rdfs:label ?itemLabel FILTER ( LANG( ?itemLabel ) = "en" )
  }
}
