PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?author ?authorLabel ?birthPlace ?birthPlaceLabel ?dateOfBirth WHERE {
  ?author wdt:P31 wd:Q5 ; wdt:P106 wd:Q482980 ; wdt:P27 wd:Q30 ; wdt:P19 ?birthPlace ; wdt:P569 ?dateOfBirth .
  FILTER NOT EXISTS {
    ?author wdt:P570 ?dateOfDeath
  }
  ?birthPlace wdt:P131 * wd:Q771 .
  FILTER ( YEAR( ?dateOfBirth ) > 1919 ) OPTIONAL {
    ?author rdfs:label ?authorLabel FILTER ( LANG( ?authorLabel ) = "en" )
  }
  OPTIONAL {
    ?birthPlace rdfs:label ?birthPlaceLabel FILTER ( LANG( ?birthPlaceLabel ) = "en" )
  }
}
ORDER BY ?dateOfBirth
LIMIT 100

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?article WHERE {
  ?article wdt:P1433 wd:Q15817086 .
  FILTER NOT EXISTS {
    ?article rdfs:label ?label .
    FILTER ( LANG( ?label ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?unit ?unitLabel ?part ?partLabel ?largerUnit ?largerUnitLabel ?geolexID WHERE {
  ?unit wdt:P31 / wdt:P279 * wd:Q3550897 .
  ?unit wdt:P131 wd:Q816 .
  OPTIONAL {
    ?unit wdt:P527 ?part .
    ?part rdfs:label ?partLabel
    FILTER ( LANG( ?partLabel ) = "en" )
  }
  OPTIONAL {
    ?unit wdt:P361 ?largerUnit .
    ?largerUnit rdfs:label ?largerUnitLabel
    FILTER ( LANG( ?largerUnitLabel ) = "en" )
  }
  OPTIONAL {
    ?unit wdt:P6202 ?geolexID .
  }
  OPTIONAL {
    ?unit rdfs:label ?unitLabel FILTER ( LANG( ?unitLabel ) = "en" )
  }
}
