  OPTIONAL {
    ?tournament wdt:P393 ?editionNumber .
  }
  OPTIONAL {
    ?tournament wdt:P585 ?pointInTime .
  }
  OPTIONAL {
    ?tournament wdt:P2094 ?surface .
    OPTIONAL {
