PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?constituency ?constituencyLabel ( COUNT( ?member ) AS ?actualSeats ) WHERE {
  ?member wdt:P39 wd:Q41582584 ; wdt:P768 ?constituency .
  OPTIONAL {
    ?constituency rdfs:label ?constituencyLabel FILTER ( LANG( ?constituencyLabel ) = "en" )
  }
}
GROUP BY ?constituency ?constituencyLabel
HAVING ( COUNT( ?member ) > 1 )
ORDER BY DESC ( ?actualSeats )

PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?person ?personLabel ?office ?officeLabel ?dob ?pob ?pobLabel ?gender ?genderLabel ?start ?end WHERE {
  ?person wdt:P39 ?office .
  ?office wdt:P279 * wd:Q3858501 .
  OPTIONAL {
    ?person wdt:P569 ?dob .
  }
  OPTIONAL {
    ?person wdt:P19 ?pob .
    OPTIONAL {
      ?pob rdfs:label ?pobLabel FILTER ( LANG( ?pobLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?person wdt:P21 ?gender .
    OPTIONAL {
      ?gender rdfs:label ?genderLabel FILTER ( LANG( ?genderLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?person p:P39 ?positionStatement .
    ?positionStatement ps:P39 ?office .
    OPTIONAL {
      ?positionStatement pq:P580 ?start .
    }
    OPTIONAL {
      ?positionStatement pq:P582 ?end .
    }
