PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?municipality ?municipalityLabel ?recentPopulation ?recentYear ?pastPopulation ?pastYear WHERE {
  ?municipality wdt:P31 / wdt:P279 * wd:Q15284 ; wdt:P131 wd:Q93366 .
  {
    SELECT ?municipality ( MAX( ?populationYear ) AS ?recentYear ) WHERE {
      ?municipality p:P1082 ?popStatement .
      ?popStatement pq:P585 ?populationYear .
    }
    GROUP BY ?municipality
  }
  ?municipality p:P1082 ?recentPopStatement .
  ?recentPopStatement ps:P1082 ?recentPopulation .
  ?recentPopStatement pq:P585 ?recentYear .
  OPTIONAL {
    {
      SELECT ?municipality ( MAX( ?pastYearSub ) AS ?pastYear ) WHERE {
        ?municipality p:P1082 ?pastPopStatement .
        ?pastPopStatement pq:P585 ?pastYearSub .
        FILTER ( ?pastYearSub <= ( ?recentYear - "P10Y" ^^ xsd:duration ) )
      }
      GROUP BY ?municipality
    }
    ?municipality p:P1082 ?pastPopStatement .
    ?pastPopStatement ps:P1082 ?pastPopulation .
    ?pastPopStatement pq:P585 ?pastYear .
  }
  OPTIONAL {
    ?municipality rdfs:label ?municipalityLabel FILTER ( LANG( ?municipalityLabel ) = "en" )
  }
}
ORDER BY ?municipality
LIMIT 20

