  ?person wdt:P412 ?voiceType .
  VALUES ?voiceType {
    wd:Q30903 wd:Q186506 wd:Q37137 wd:Q223166 wd:Q27914 wd:Q31687 wd:Q27911
  }
  FILTER NOT EXISTS {
    ?person wdt:P106 ?occupation
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?voiceType rdfs:label ?voiceTypeLabel FILTER ( LANG( ?voiceTypeLabel ) = "en" )
  }
}

PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?entity ?entityLabel ?idescatCode ?population ?area ?coatOfArmsImage WHERE {
  ?entity wdt:P4335 ?idescatCode .
  FILTER ( STRSTARTS( ?idescatCode , "25" ) ) ?entity wdt:P131 * wd:Q5705 .
  OPTIONAL {
    ?entity p:P1082 ?populationStatement .
    ?populationStatement ps:P1082 ?population ; wikibase:rank wikibase:PreferredRank .
  }
  OPTIONAL {
    ?entity wdt:P2046 ?area .
  }
  OPTIONAL {
    ?entity wdt:P94 ?coatOfArmsImage .
  }
  OPTIONAL {
    ?entity rdfs:label ?entityLabel FILTER ( LANG( ?entityLabel ) = "en" )
  }
}
ORDER BY ?entityLabel
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?item ?itemLabelEN WHERE {
  ?item rdfs:label "Madonna and Child" @en .
  FILTER NOT EXISTS {
    ?item rdfs:label ?itemLabelFR FILTER ( LANG( ?itemLabelFR ) = "fr" )
  }
  OPTIONAL {
    ?item rdfs:label ?itemLabelEN FILTER ( LANG( ?itemLabelEN ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?library ?libraryLabel ?part ?partLabel WHERE {
  VALUES ?library {
    wd:Q29093975 wd:Q29094048 wd:Q30622211 wd:Q30623837 wd:Q30625944 wd:Q7858217
  }
  ?library wdt:P527 ?part .
  OPTIONAL {
    ?library rdfs:label ?libraryLabel FILTER ( LANG( ?libraryLabel ) = "en" )
  }
  OPTIONAL {
    ?part rdfs:label ?partLabel FILTER ( LANG( ?partLabel ) = "en" )
  }
}
ORDER BY ?libraryLabel ?partLabel

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?country ?countryLabel ( COUNT( ?airport ) AS ?operationalAirports ) ?population WHERE {
  ?airport wdt:P31 wd:Q1248784 .
  ?airport wdt:P131 ?adminEntity .
  ?adminEntity wdt:P17 ?country .
  FILTER NOT EXISTS {
    ?airport wdt:P582 ?endTime
  }
  FILTER NOT EXISTS {
    ?airport wdt:P576 ?dissolvedDate
  }
  ?country wdt:P1082 ?population .
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
GROUP BY ?country ?countryLabel ?population
ORDER BY DESC ( ?operationalAirports )
LIMIT 100

