  }
}

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?member ?memberLabel ?startTime ?electoralDistrict ?electoralDistrictLabel ?election ?electionLabel WHERE {
  ?member p:P39 ?statement .
  ?statement ps:P39 wd:Q29169698 ; pq:P580 ?startTime .
  OPTIONAL {
    ?statement pq:P768 ?electoralDistrict .
    ?electoralDistrict rdfs:label ?electoralDistrictLabel
    FILTER ( LANG( ?electoralDistrictLabel ) = "en" )
  }
  OPTIONAL {
    ?statement pq:P2710 ?election .
    ?election rdfs:label ?electionLabel
    FILTER ( LANG( ?electionLabel ) = "en" )
  }
  FILTER NOT EXISTS {
    ?statement pq:P582 ?endTime .
  }
  ?member rdfs:label ?memberLabel FILTER ( LANG( ?memberLabel ) = "en" )
}
LIMIT 100

